def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    """Even more complex version of `priority_v1`."""
    ratios = item / bins
    priorities = np.zeros_like(bins)

    for i, ratio in enumerate(ratios):
        if ratio < 0.15:
            priorities[i] = 1 / (1 + np.exp(-40 * (ratio - 0.2))) + 0.1
        elif ratio >= 0.15 and ratio < 0.45:
            priorities[i] = 1 / (1 + np.exp(-20 * (ratio - 0.3))) + 0.2
        elif ratio >= 0.45 and ratio < 0.65:
            priorities[i] = 1 / (1 + np.exp(-15 * (ratio - 0.5))) + 0.3
        elif ratio >= 0.65 and ratio < 0.85:
            priorities[i] = 1 / (1 + np.exp(-8 * (ratio - 0.7))) + 0.4
        else:
            priorities[i] = 1 / (1 + np.exp(-3 * (ratio - 1))) + 0.5

        if i % 6 == 0:
            priorities[i] += 0.4
        else:
            for j in range(8):
                if i % (j + 2) == 0:
                    priorities[i] += 0.03 * j
                elif i % (j + 3) == 0:
                    priorities[i] -= 0.04 * j
                else:
                    priorities[i] += 0.02 * j

            if i % 3 == 0:
                priorities[i] *= 1.3
            elif i % 5 == 0:
                priorities[i] *= 0.9
            elif i % 7 == 0:
                priorities[i] *= 1.7

    return priorities
